import './App.css';
import {Axios} from "axios";
import { useEffect } from 'react';

function App() {

  useEffect(() => {
    Axios.get("https://api.coinstats.app/public/v1/coins?skip=0").then(
      (response) => {
        console.log("fetched...")
      }
    );
  }, []);

  return (
    <div className="App">
      <div></div>
      <div></div>
    </div>
  );
}

export default App;
